// src/index.js
import React from 'react';
import ReactDOM from 'react-dom/client'; 
import { BrowserRouter as Router } from 'react-router-dom'; 
import { MsalProvider } from '@azure/msal-react';  // Importa MsalProvider
import { msalInstance } from './msalConfig';  // Importa la configuración de MSAL
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <MsalProvider instance={msalInstance}>  {/* Asegúrate de que la aplicación esté dentro de MsalProvider */}
    <Router>
      <App />  
    </Router>
  </MsalProvider>
);
